// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/proxy/Initializable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721Holder.sol";

import "./FwarCharStorage.sol";

interface IFwarChar {
    function mint(address _user, uint32 tokenId, uint8 _level, uint8 _rarity, uint8 _elementType, uint32 _teamId, 
        uint32 _attack, uint32 _defend, uint32 _health ) external;
    function upgrade(uint32 _tokenId, uint8 _level, uint32 _attack, uint32 _defend, uint32 _health) external;
    function totalSupply() external view returns (uint);
    function getCharInfo(uint32 _id) external view returns (uint8 level, uint8 rarity, uint8 elementType, 
        uint32 teamId, uint32 attack, uint32 defend, uint32 health) ;
    function getCharBaseInfo(uint32 _id) external view returns (uint32 baseAttack, uint32 baseDefend, uint32 baseHealth);
    function burn(uint32 _tokenId) external;
}

interface IFwarKey{
    function burn(address _from, uint256 _amount) external;
}
interface ISeed {
    function getSeed() external returns(uint256);
}


contract FwarCharDelegate is Initializable, AccessControl, ERC721Holder, FwarCharStorage {
    using SafeERC20 for IERC20;

    event MintNFT(uint32 indexed tokenId, uint8 level, uint8 indexed rarity, uint8 indexed elementType, uint32 teamId, uint32 attack, uint32 defend, uint32 health);

    //event MintNFT(uint32 indexed tokenId, uint8 indexed level, uint8 indexed rarity, uint8 indexed elementType, uint8 teamId, uint32 attack, uint32 defend, uint32 health);

    function initialize(address admin, address _fwarCharAddress,address _seedAddress, address _fwarKeyAddress) public payable initializer {
        _setupRole(DEFAULT_ADMIN_ROLE, admin);

        fwarCharAddress = _fwarCharAddress;
        seedAddress = _seedAddress;
        fwarKeyAddress = _fwarKeyAddress;

        // 55%, 27%, 15%, 3%
        RARITY_MASK.push(55);
        RARITY_MASK.push(82);
        RARITY_MASK.push(97);
        RARITY_MASK.push(100);

        // 20%, 20%, 20%, 20%, 20%
        ELEMENT_MASK.push(1);
        ELEMENT_MASK.push(2);
        ELEMENT_MASK.push(3);
        ELEMENT_MASK.push(4);
        ELEMENT_MASK.push(5);

        MULTIPLER = 1e3;

        //teamadded
        addTeamInfo(0,100,80,150,120,1000,800);
    }

    //Check TeamInfos exist
    function isTeamInfo(uint teamId) private view returns(bool isExist) {
        if(teamIdList.length == 0) return false;
        return (teamIdList[teamInfos[teamId].listPointer] == teamId);
    }


    function addTeamInfo(uint32 teamId, uint32 maxAttack, uint32 minAttack, uint32 maxDefend,
        uint32 minDefend, uint32 maxHealth, uint32 minHealth) public 
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), 'Admin role is required');
        if(isTeamInfo(teamId)) revert();

        teamInfos[teamId].maxAttack   = maxAttack;
        teamInfos[teamId].minAttack   = minAttack;
        teamInfos[teamId].maxDefend   = maxDefend;
        teamInfos[teamId].minDefend   = minDefend;
        teamInfos[teamId].maxHealth   = maxHealth;
        teamInfos[teamId].minHealth   = minHealth;
        teamInfos[teamId].listPointer = uint32(teamIdList.length);
        teamIdList.push(teamId);
    }

    function updateTeamInfo(uint32 teamId, uint32 maxAttack, uint32 minAttack, uint32 maxDefend,
        uint32 minDefend, uint32 maxHealth, uint32 minHealth) public 
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), 'Admin role is required');
        if(!isTeamInfo(teamId)) revert();

        teamInfos[teamId].maxAttack = maxAttack;
        teamInfos[teamId].minAttack = minAttack;
        teamInfos[teamId].maxDefend = maxDefend;
        teamInfos[teamId].minDefend = minDefend;
        teamInfos[teamId].maxHealth = maxHealth;
        teamInfos[teamId].minHealth = minHealth;
    }

    function deleteTeamInfo(uint32 teamId) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), 'Admin role is required');
        if(!isTeamInfo(teamId)) revert();

        uint32 rowToDelete = teamInfos[teamId].listPointer;
        uint32 deletedId   = teamIdList[teamIdList.length-1];
        teamIdList[rowToDelete] = deletedId;
        teamInfos[deletedId].listPointer = rowToDelete;
        teamIdList.pop();
    }

    function setSeedAddress(address _seedAddress) external {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), 'Admin role is required');
        seedAddress = _seedAddress;
    }

    function setFwarCharAddress(address _fwarCharAddress) external {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), 'Admin role is required');
        fwarCharAddress = _fwarCharAddress;
    }

    function setBurnInfos(uint8 _ratity, uint8 _level, uint8 _junkAmount, uint8 _normalAmount,  uint8 _rareAmount, 
        uint8 _baseAmount, uint8 _percentConsume, uint8 _percentOnBase) external 
    {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), 'Admin role is required');
        require(_ratity >= 4, "Rarity must greater than 3");

        burnInfos[_ratity][_level].junkAmount = _junkAmount;
        burnInfos[_ratity][_level].normalAmount = _normalAmount;
        burnInfos[_ratity][_level].rareAmount = _rareAmount;
        burnInfos[_ratity][_level].baseAmount = _baseAmount;
        burnInfos[_ratity][_level].percentConsume = _percentConsume;
        burnInfos[_ratity][_level].percentOnBase = _percentOnBase;
        burnInfoCount.add(1);
    }

    function getBurnInfo(uint8 _ratity, uint8 _level) external view returns(uint8 junkAmount, uint8 normalAmount, uint8 rareAmount, uint8 baseAmount){
        junkAmount = burnInfos[_ratity][_level].junkAmount;
        normalAmount = burnInfos[_ratity][_level].normalAmount;
        rareAmount = burnInfos[_ratity][_level].rareAmount;
        baseAmount = burnInfos[_ratity][_level].baseAmount;

        return (junkAmount , normalAmount, rareAmount, baseAmount);
    }

    function OpenItems(address user, uint number) external {
        require(number > 0 && number < 11, "Number of Chest should greater than 0 and less than 11");
        //require(msg.sender == tx.origin, "can not call from contract");
        //Burn Keys    
        IERC20(fwarKeyAddress).transferFrom(msg.sender, address(this), number.mul(1e8));
        IFwarKey(fwarKeyAddress).burn(address(this),number.mul(1e18));

        for(uint i = 0; i < number; i++)
        {   
            uint tokenId = ISeed(seedAddress).getSeed();
            CharInfo memory charInfo = randomCharStats(user, tokenId);

            IFwarChar(fwarCharAddress).mint(user, uint32(tokenId), charInfo.level, charInfo.rarity, charInfo.elementType,
            charInfo.teamId, charInfo.attack, charInfo.defend, charInfo.health);

            emit MintNFT(uint32(tokenId), charInfo.level, charInfo.rarity, charInfo.elementType,
            charInfo.teamId, charInfo.attack, charInfo.defend, charInfo.health);
        }
    }

    function randomCharStats(address _user, uint _seed) internal view returns 
    (
        CharInfo memory charInfo
    ) {
        uint random1 = uint(keccak256(abi.encode(blockhash(block.number.sub(1)), _seed, _user)));
        uint random2 = uint(keccak256(abi.encode(random1)));
        uint random3 = uint(keccak256(abi.encode(random2)));
        uint random4 = uint(keccak256(abi.encode(random3)));
        uint random5 = uint(keccak256(abi.encode(random4)));
        uint random6 = uint(keccak256(abi.encode(random5)));

        charInfo.level = 1;

        charInfo.rarity = uint8(getMaskValue(random6.mod(100), RARITY_MASK).add(1));
        charInfo.elementType = uint8(getMaskValue(random5.mod(5), ELEMENT_MASK).add(1));
        charInfo.teamId = uint32(getActiveTeamId(random4));
        charInfo.attack = randomStatistic(random3, teamInfos[charInfo.teamId].maxAttack,teamInfos[charInfo.teamId].minAttack).mul(MULTIPLER);
        charInfo.defend = randomStatistic(random2, teamInfos[charInfo.teamId].maxDefend,teamInfos[charInfo.teamId].minDefend).mul(MULTIPLER);
        charInfo.health = randomStatistic(random1, teamInfos[charInfo.teamId].maxHealth,teamInfos[charInfo.teamId].minHealth).mul(MULTIPLER);
    }

    function getActiveTeamId (uint random) private view returns (uint){
        require(teamIdList.length > 0, "Does not have any Team");
        uint index = random.mod(teamIdList.length);
        return teamIdList[index];

    }

    function getMaskValue(uint random, uint[] memory mask) private pure returns (uint) {
        for (uint i=0; i<mask.length; i++) {
            if (random < mask[i]) {
                return i;
            }
        }
    }


    function randomStatistic(uint random, uint32 max, uint32 min) private pure returns (uint32 value){
        value = uint32(random.mod(max.sub(min)).add(min));
        return value;
    }

    /// @dev upgrade is called by a user
    /// @param _mainNFTId is the NFT Id of nft which want to upgrade
    /// @param _burnedNfts is the array of nftId which use to burn for mainNFT

    //Need check isSelling or Not
    function upgrade(uint32 _mainNFTId, uint32[] calldata _burnedNfts) external
    {
        require(_mainNFTId != 0, "main NFTId error");
        require(IERC721(fwarCharAddress).ownerOf(_mainNFTId) == msg.sender, "You have no access");

        CharInfo memory mainNFT = getCharInfo(_mainNFTId);

        require(isUpgradable(mainNFT.rarity) == 1, 'NFT can not upgrade');

        (uint32 totalAttack, uint32 totalDefense, uint32 totalHealth) = verifyBurnedNfts(mainNFT, _burnedNfts);

        for (uint i = 0; i < _burnedNfts.length; i++) {
            IFwarChar(fwarCharAddress).burn(_burnedNfts[i]);
        }

        uint8 percentConsume = burnInfos[mainNFT.rarity][mainNFT.level].percentConsume;
        uint8 percentBase = burnInfos[mainNFT.rarity][mainNFT.level].percentConsume;

        mainNFT.attack = mainNFT.attack.add(totalAttack.mul(percentConsume).div(MULTIPLER)).add(mainNFT.baseAttack.mul(percentBase).div(MULTIPLER));
        mainNFT.defend = mainNFT.defend.add(totalDefense.mul(percentConsume).div(MULTIPLER)).add(mainNFT.baseDefend.mul(percentBase).div(MULTIPLER));
        mainNFT.health = mainNFT.health.add(totalHealth.mul(percentConsume).div(MULTIPLER)).add(mainNFT.baseHealth.mul(percentBase).div(MULTIPLER));

        IFwarChar(fwarCharAddress).upgrade(_mainNFTId, mainNFT.level.add(1), mainNFT.attack, mainNFT.defend, mainNFT.health);

    }

    /// @dev isUpgradable
    /// @param _rarity is the rarity of NFT which want to check
    function isUpgradable(uint _rarity) internal pure returns (uint returnVal){
        if(_rarity >= 4) {
            returnVal = 1;
        }
        return returnVal;
    }

    /// @dev getCharInfo
    /// @param _nftId is the id of NFT
    function getCharInfo(uint32 _nftId) internal view returns (CharInfo memory charInfo){
        (charInfo.level, charInfo.rarity, charInfo.elementType, charInfo.teamId,
            charInfo.attack, charInfo.defend, charInfo.health) = IFwarChar(fwarCharAddress).getCharInfo(_nftId);
        charInfo = getCharBaseInfo(_nftId, charInfo);
        return charInfo;
    }

    /// @dev getCharBaseInfo
    /// @param _nftId is the id of NFT
    /// @param _charInfo is the struct info will be fill
    function getCharBaseInfo(uint32 _nftId, CharInfo memory _charInfo) internal view returns (CharInfo memory){
        (_charInfo.baseAttack, _charInfo.baseDefend, _charInfo.baseHealth) = IFwarChar(fwarCharAddress).getCharBaseInfo(_nftId);
        return _charInfo;
    }

    /// @dev verifyBurnedNfts
    /// @param _burnedNfts is the id of NFT
    function verifyBurnedNfts(CharInfo memory _mainNFT, uint32[] memory _burnedNfts) internal view
        returns (uint32 totalAttack, uint32 totalDefense, uint32 totalHealth)
    {
        uint8 junkAmount;
        uint8 normalAmount;
        uint8 rareAmount;
        uint8 baseAmount;

        for (uint i = 0; i < _burnedNfts.length; i++) {
            require(_burnedNfts[i] != 0, "burned NFTId error");
            require(IERC721(fwarCharAddress).ownerOf(_burnedNfts[i]) == msg.sender, "You have no access");

            CharInfo memory charInfo = getCharInfo(_burnedNfts[i]);

            require(_mainNFT.teamId == charInfo.teamId, "Burned NFT should have same team");
            require(_mainNFT.elementType == charInfo.elementType, "Burned NFT should have same element");         

            totalAttack = totalAttack.add(charInfo.attack);
            totalDefense = totalDefense.add(charInfo.defend);
            totalHealth = totalHealth.add(charInfo.health);

            if(charInfo.rarity == 1) {
                junkAmount = junkAmount.add(1);
            }
            if(charInfo.rarity == 2) {
                normalAmount = normalAmount.add(1);
            }

            if(charInfo.rarity == 3) {
                rareAmount = rareAmount.add(1);
            }

            if(charInfo.rarity == _mainNFT.rarity) {
                baseAmount = baseAmount.add(1);
                if(_mainNFT.level<30){
                    require(_mainNFT.level >= charInfo.level, 'Burned NFT should have level <= main NFT');
                }else{
                    require(_mainNFT.level == charInfo.level, 'Burned NFT should have same level');
                }

            }
        }

        require(burnInfos[_mainNFT.rarity][_mainNFT.level].junkAmount == junkAmount, "amount of junk is incorrect");
        require(burnInfos[_mainNFT.rarity][_mainNFT.level].normalAmount == normalAmount, "amount of normal is incorrect");
        require(burnInfos[_mainNFT.rarity][_mainNFT.level].rareAmount == rareAmount, "amount of rare is incorrect");
        require(burnInfos[_mainNFT.rarity][_mainNFT.level].baseAmount == baseAmount, "amount of base is incorrect");
    }
}

